import React from "react";

function SortButton() {
  return (
    <div className="sortBtn">
      <button>All</button>
      <button>To Start</button>
      <button>Ongoing</button>
      <button>Done</button>
      <button>Overdue</button>
    </div>
  );
}

export default SortButton;
